import React from "react";

import { makeStyles } from "@mui/styles";
import { Grid, Card, CardContent, Typography, Button } from "@mui/material";
import ArrowComponent from "../ArrowComponent";
import theme from "../theme";
import ThumbUpIcon from "@mui/icons-material/ThumbUp";

import infoBackground from "../../../assets/infoBackground.svg";

const useStyle = makeStyles(() => ({
  aboutandcontactbackground: {
    backgroundImage: `url(${infoBackground})`,
    backgroundPosition: "center",
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    height: "40em",
    width: "100%",
  },
  aboutandcontactBtn: {
    "&.MuiButton-root": {
      ...theme.typography.learnMoreBtn,
    },
  },
  aboutandcontacttitles: {
    "&.MuiTypography-root": {
      fontWeight: "bold",
      fontSize: 25,
      color: theme.palette.common.grey,
    },
  },
  description: {
    "&.MuiTypography-root": {
      color: theme.palette.common.grey,
    },
  },
}));

const ContactAndAboutSection: React.FC = () => {
  const classes = useStyle();

  return (
    <Grid container direction='row' sx={{ flexWrap: "wrap" }}>
      <Grid item xs={6}>
        <Grid container justifyContent='flex-start' alignItems='center'>
          <Typography className={classes.aboutandcontacttitles}>
            About Us
          </Typography>
          <Typography className={classes.description}>
            Let's get personal.
          </Typography>
          <Button variant='outlined' className={classes.aboutandcontactBtn}>
            Learn More
          </Button>
        </Grid>
      </Grid>
      <Grid item xs={6}>
        <Grid container justifyContent='flex-end' alignItems='center'>
          <Grid item>
            <Typography className={classes.aboutandcontacttitles}>
              Contact Us
            </Typography>
            <Typography className={classes.description}>
              <span>Say Hello!</span>
              <ThumbUpIcon
                sx={{ paddingTop: "0.5em", color: theme.palette.common.grey }}
                fontSize='small'
              />
            </Typography>
            <Button variant='outlined' className={classes.aboutandcontactBtn}>
              <span>Learn more</span>
              <ArrowComponent
                width={10}
                height={10}
                fill={theme.palette.common.blue}
              />
            </Button>
          </Grid>
        </Grid>
      </Grid>
      <div className={classes.aboutandcontactbackground} />
    </Grid>
  );
};

export default ContactAndAboutSection;
